import { useState } from "react";

function App() {
  const [weeklyReport, setWeeklyReport] = useState(null);
  const getWeeklyReport = async () => {
    const response = await fetch("/api/get_weekly_summary_report", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    });
    const data = await response.json();
    let weeklyReport = data.weeklyReport;
    for (const [key, value] of Object.entries(weeklyReport)) {
      const newKey = new Date(key).toLocaleDateString("en-GB", {
        timeZone: "Asia/Jerusalem",
      });
      console.log(newKey);
    }
    console.log(data);
  };

  getWeeklyReport();
  return <div className="bg-white-20 h-[100dvh] p-10">
    <h1>Reporting</h1>
  </div>;
}

export default App;
